import ContainerStyle from "./components/Container/ContainerStyle";
import Container from "./components/Container";
import SearchResultsStyles from "./components/SearchResults/SearchResultsStyles";
import SearchResults from "./components/SearchResults";
import PartyResults from "./components/PartyResults";

const App = () => {
  return (
    <ContainerStyle>
      <Container>
        {({
          onSearchChange,
          queryError,
          status,
          onDelete,
          onSelect,
          partyMorty,
          partyRick,
          searchValue,
          displayedCharacters,
        }: any) => (
          <>
            <div className="App">
              <input
                placeholder="Enter a character name"
                onChange={onSearchChange}
                value={searchValue}
              />
            </div>
            <SearchResultsStyles>
              <SearchResults
                characters={displayedCharacters}
                status={status}
                queryError={queryError}
                onDelete={onDelete}
                onSelect={onSelect}
              />
            </SearchResultsStyles>
            <PartyResults partyRick={partyRick} partyMorty={partyMorty} />
          </>
        )}
      </Container>
    </ContainerStyle>
  );
};

export default App;
